import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "./Card";
import ExpensesFilter from "./ExpensesFilter";
function Expenses(props) {
  const onYearChangeHandler=(data)=>{
    console.log(data);
  }
  return (
    <div>
      <ExpensesFilter onYearChange={onYearChangeHandler}></ExpensesFilter>
    <Card className="expenses">
      {props.expenses.map(expenses=><ExpenseItem title={expenses.title} amount={expenses.amount}
        date={expenses.date}/>)}
    </Card>
    </div>
  );
}

export default Expenses;
